    var json: JSON { return parseString(gigsString) }
    var errorJSON: JSON { return parseString(errorString) }
    
    func testParseInvalidResponseShouldReturnError() {
        let result = Parser.parseGigs(errorJSON)
        
        switch result {
        case .Success(_): XCTFail("data should give an error")
            
        case .Failure(let error):
            switch error {
            case .ParsingError(let errorMessage):
                XCTAssertEqual("Resource not found", errorMessage)
            default:
                XCTAssert(false, "error should be parsing error")
            }
        }
    }
    
    func testParseArtistShouldHaveCorrectProperties() {
        let result = Parser.parseGigs(json)
        
        switch result {
        case .Failure(_): XCTFail("gigs should have correct data")
            
        case .Success(let gigs):
            let expectedDate = "2015-07-02".sk_date!
            
            let gig = gigs.first!
            
            XCTAssertEqual(24083104, gig.id)
            XCTAssertEqual("Wheeland Brothers with Fireworks at Milliken\'s Reef at Port Canaveral (July 2, 2015)", gig.name)
            XCTAssertEqual(expectedDate.timeIntervalSinceReferenceDate, gig.date!.timeIntervalSinceReferenceDate)
            XCTAssertEqual("http://www.songkick.com/concerts/24083104-wheeland-brothers-at-millikens-reef-at-port-canaveral?utm_source=26333&utm_medium=partner", gig.uri)
            XCTAssertEqual("Milliken's Reef at Port Canaveral", gig.venue)
            XCTAssertEqual(28.40803, gig.coordinate!.latitude)
            XCTAssertEqual(-80.6199069, gig.coordinate!.longitude)
        }
    }

    func testParseGigsShouldParseAllGigs() {
        let result = Parser.parseGigs(json)
        
        switch result {
        case .Failure(_): XCTFail("gigs should have correct data")
            
        case .Success(let gigs):
            XCTAssertEqual(19, gigs.count)
        }
    }

